window.bookSummaryJSON = "<p>Afterlife, just a place for an unhappy king to call home or soon to become a beacon of hope when a new waitress falls at his feet? </p> <p>The Gothic nightclub is about to welcome a new guest, and this time it is one he can’t control. As for Dominic Draven, the king of all supernatural life, handling just one little mortal named Keira should be no problem for him…right?</p> <p>Wrong!</p> <p>As she is his chosen one, she is not meant to be ruled by a domineering, overbearing, arrogant boss who is determined to keep her at arm’s length. But instead, she is meant to achieve the impossible and crack the hard shell of an immortal king that is only now learning what it truly means to fall in love. </p> <p>This is the story of Afterlife, only from the eyes of its king. As you will finally follow Keira’s journey all over again, only through Dominic Draven’s point of view, giving it a whole new and exciting twist on the start of this epic saga. </p>"; 
